import React from 'react';
import './App.css';

// Main Page -- What is displayed across all pages
function App() {
    return (
        <div className="bg-red-600 min-h-screen flex flex-col items-center justify-center text-white">
            <h1 className="text-4xl font-bold mb-4">
                <span className="text-gray-100">D</span>
                <span className="text-yellow-300">A</span>
                <span className="text-white">V</span>
                <span className="text-gray-200">E</span>
            </h1>
            <p className="text-xl md:text-2xl font-medium text-gray-200">
                A <span className="text-yellow-300 font-semibold">Dynamic</span> Algorithm <span
                className="text-white">Visualizer</span>
            </p>
            <button className="mt-8 px-6 py-2 bg-white text-red-600 rounded-md hover:bg-gray-100 focus:outline-none">
                Learn More
            </button>
        </div>
    );
}

export default App;
